import './App.css';
import MoreInfo from './pages/MoreInformation';
import SearchPage from './pages/SearchPage';
import MainPage from './pages/MainPage';
import {Routes,Route,Link} from 'react-router-dom' 

function App() {
  return (
    <>
      <header>
      <div className="App">
      <MainPage/>
      <SearchPage />
      <MoreInfo/>
      </div >
      </header>
      </>
  );
}
export default App;
